pragma solidity ^0.8.1;
// SPDX-License-Identifier: GPL-3.0

contract Funding {
    address public owner;
    uint public moneyPool;
    bool public isAvaliable;
    address public a;

    constructor() {
        owner = msg.sender;
        a = owner;
    }


    function fundTo() payable external {
        require(isAvaliable, "This project not avaliable to fund");
        moneyPool += msg.value;
    }

     function startFunding() external{
        require(msg.sender == owner, "Only owner can start this funding project");
        isAvaliable = true;
    }

    function endFunding() external{
        require(msg.sender == owner, "Only owner can close this funding project");
        isAvaliable = false;
        payable(owner).transfer(moneyPool);
    }

    function getOwner() external view returns(address){
        return owner;
    }
}
